import React, { Component } from 'react';

class Graph extends Component {
    render() {

        console.log(this.props.data)
        return this.props.data.map((data) => (

            <p>  
            <h3> {data.price} </h3>
            <h3> {data.price} </h3>
            <h3> {data.price} </h3>
            <h3> {data.price} </h3>

            </p>
        ));
    }
}

export default Graph;
